    "description" : "Используйте этот раздел для названий видов насекомых (phylum Arthropoda, class Insecta). Обратите внимание, что насекомые имеют по шесть лапок, а пауки по восемь. Тем не менее, некоторые языки могут не различать насекомых и пауков и могут использовать другие характеристики, чтобы подразделять членистоногих.",
