    "description" : "Используйте этот раздел для обобщающих слов, относящихся ко всему телу человека, и общих слов для любой части тела. Используйте рисунок или фото, чтобы пометить каждую часть. Некоторые слова могут давать более обобщенное понятие, чем другие и включать некоторые другие слова. Например 'голова' более общее слово, чем 'лицо' или 'нос'. Но не забудьте пометить как общие, так и отдельные части.",
