    "description" : "Используйте этот раздел для непристойных слов, относящихся к сексу, испражнениям. смерти, проклятию и другим запрещенным или оскорбительным темам. Необходимо проверять уместность включения непристойных слов в словарь. Это должно быть выбором носителя языка, следует ли какое-то слово включать или нет. Непристойные слова должны иметь соответствующую пометку. Непристойности очень часто используются для усиления экспрессии, и часто когда кто-либо гневается. Непристойности часто связаны с сексом и испражнениями. Проклятия часто связаны с Богом, религией и загробной жизнью. Оскорбления часто включают в себя слова приравнивающие человека с животным, и в связи с его нежелательными качествами, вопросы касающиеся происхождения или родословия, вопросы относительно чьего-либо характера, умственных способностей/рассудка.",
