    "description" : "Используйте этот раздел для слов, имеющих отношение к специальной одежде, одеваемой на особенные события. Необходимо продумать все возможные особенные события в данной культуре и специальную одежду, предназначенную для таких событий. Два примера внизу даны на случай работы и по поводу окончания учебного заведения, но имеется много других событий.",
