    "description" : "Используйте этот раздел для слов, относящихся к наготе -- не иметь на себе какой-либо одежды, и для слов, имеющих отношение к тому, как человек чувствует себя в голом состоянии. Это является частью всеобщего человеческого опыта, когда люди не хотят быть обнаженными. Поэтому в этом разделе включены слова, которые относятся к плохому ощущению, когда кто-либо не имеет на себе достаточно одежды (стыд). Другие слова  относятся к желанию иметь достаточное количество одежды (скромный). Иные слова относятся к тому, как люди себя чувствуют по отношению к другим людям, не имеющим на себе достаточно одежды (непристойный/непривлекательный).",
