    "name" : "Двигаться, передвигаться, перемещаться",
    "description" : "Используйте этот раздел для непереходных глаголов движения, относящихся к перемещению всего вашего тела в другое местоположение. имеется много компонентов значений, связанных с глаголами движения. Они могут включать исходное местоположение (откуда), место назначения (куда), путь (по, вдоль), способ (пешком, бегом), скорость (наперегонки, ползать), направление (вперед, назад, в сторону, вверх, вниз, по направлению, прочь от), очертание пути (прямой, кривой, круговой, с загибами), отношение к какому-то объекту или объектам (по, над, рядом, между, через, внутри, из, отдаляясь от, вокруг), близость (рядом, на отдалении), многократно повторяющиеся движения (назад и вперед, возвращаясь, подпрыгивая), включения других объектов или частей объектов (соединять, покидать, собирать, разгонять, объединять, разделять), волевое решение (идти против течения), непереходное или переходное значение (двигать или двигать что-либо). Некоторые глаголы движения не включают движение с одного места в другое, но выражают движение тела.",
