    "description" : "Используйте этот раздел для слов, указывающих на то, что что-то становится спутанным -- когда что-либо длинное и тонкое, как например, веревка, шнурок, нитка, волосы, трава или вьющееся растение находятся в беспорядке, становятся переплетенными или завязываются в узлы, так что их трудно разделить",
