  "9.4.1.2" : {
    "guid" : "ccbbd16f-58c5-45c1-bfff-1fba64d9740e",
    "key" : "9.4.1.2",
    "abbr" : "9.4.1.2",
    "name" : "Аспект (вид) -- глаголы движения",
    "description" : "Используйте эту секцию для вспомогательных глаголов, глагольных аффиксов, наречий и частиц, которые показывают аспект глаголов движения. Аспекты описывают временной контур ситуации. Они могут сочетаться с каким-то другим временем, или в одной и той же морфеме, или в комбинации морфем. Следующие определения взяты из книги Байби, Джоана, Ревира Перкинса и Уильяма Пальука Эволюция Грамматики, 1994, Чикаго, Лондон, журнал Чикагского университета.",
    "value" : "9.4.1.2 Аспект (вид) -- глаголы движения"
  },
  "9.4.1.3" : {
    "guid" : "321d0a74-705f-40bf-8d24-809f65bee895",
    "key" : "9.4.1.3",
    "abbr" : "9.4.1.3",
    "name" : "Аспект -- глаголы состояния",
    "description" : "Используйте эту секцию для вспомогательных глаголов, глагольных аффиксов, наречий и частиц, которые показывают аспект глаголов состояния. Аспекты описывают временной контур ситуации. Они могут сочетаться с каким-то другим временем, или в одной и той же морфеме, или в комбинации морфем. Следующие определения взяты из книги Байби, Джоана, Ревира Перкинса и Уильяма Пальука Эволюция Грамматики, 1994, Чикаго, Лондон, журнал Чикагского университета.",
    "value" : "9.4.1.3 Аспект -- глаголы состояния"
  },
  "9.4.1.4" : {
    "guid" : "54f59b23-a2e8-4bfc-9da2-7dd7c37d2a47",
    "key" : "9.4.1.4",
    "abbr" : "9.4.1.4",
    "name" : "Относительные (реляционные) грамматические времена",
    "description" : "Используйте эту секцию для вспомогательных глаголов, глагольных аффиксов, наречий и частиц, которые показывают реляционные грамматические времена. Реляционные времена описывают ситуацию, где время упоминания не является тем же самым по отношению к моменту речи. Они могут сочетаться с каким-то другим временем, или в одной и той же морфеме, или в комбинации морфем. Следующие определения взяты из книги Байби, Джоана, Ревира Перкинса и Уильяма Пальука Эволюция Грамматики, 1994, Чикаго, Лондон, журнал Чикагского университета.",
    "value" : "9.4.1.4 Относительные (реляционные) грамматические времена"
  },
