    "name" : "Названия городов",
    "description" : "Используйте этот раздел для личных имен (названий) городов и поселков, деревень в пределах территории распространения языка. Включайте названия важных городов за пределами языковой территории, если ваш язык имеет специальное название для такого города или другое произношение для него. Было бы неплохо использовать для этого карту. На самом деле хорошо включить карту языковой территории в издаваемом словаре. Если территория распространения вашего языка очень большая, то на ней могут быть сотни и тысячи городов, поселений и деревень. В таком случае вам следует решить, какие из них включать в словарь. Или вы можете решить сделать их список в специальной секции.",
